(17, 'Attahiru Bafarawa', 'mmxx140610@gmail.com', '84267147142', 'Business Partner', 'Dear Partner; \r\n \r\nI came across your email contact on Database; Where i was searching for a competent Partner who can handle a lucrative business for me as trustee and manager. I anticipate to read from you soon so I can provide you with more details. \r\n \r\nYours Sincerely, \r\nAlh. Attahiru Bafarawa', '2021-04-19 17:45:26', '2021-04-19 17:45:26'),
(18, 'Enriqueurink', 'no-replymeepleporry@gmail.com', '83536538831', 'Want more customers for your business?', 'Hi!  traivis.com \r\n \r\nDo you know the best way to point out your product or services? Sending messages exploitation contact forms will enable you to simply enter the markets of any country (full geographical coverage for all countries of the world).  The advantage of such a mailing  is that the emails which will be sent through it\'ll find yourself in the mailbox that\'s intended for such messages. Causing messages using Contact forms is not blocked by mail systems, which means it is guaranteed to reach the recipient. You\'ll be able to send your supply to potential customers who were previously inaccessible thanks to email filters. \r\nWe offer you to check our service for gratis. We will send up to 50,000 message for you. \r\nThe cost of sending one million messages is us $ 49. \r\n \r\nThis letter is created automatically. Please use the contact details below to contact us. \r\n \r\nContact us. \r\nTelegram - @FeedbackMessages \r\nSkype  live:contactform_18 \r\nWhatsApp - +375259112693', '2021-04-20 03:00:35', '2021-04-20 03:00:35'),
