(21, 243, 14, 13, 'Why Use Java?', 'why-use-java', '<h2>What is Java?</h2>\r\n\r\n<p>Java is a popular programming language, created in 1995.</p>\r\n\r\n<p>It is owned by Oracle, and more than&nbsp;<strong>3 billion</strong>&nbsp;devices run Java.</p>\r\n\r\n<p>It is used for:</p>\r\n\r\n<ul>\r\n	<li>Mobile applications (specially Android apps)</li>\r\n	<li>Desktop applications</li>\r\n	<li>Web applications</li>\r\n	<li>Web servers and application servers</li>\r\n	<li>Games</li>\r\n	<li>Database connection</li>\r\n	<li>And much, much more!</li>\r\n</ul>\r\n\r\n<hr />\r\n<h2>Java works on different platforms (Windows, Mac, Linux, Raspberry Pi, etc.)</h2>\r\n\r\n<ul>\r\n	<li>It is one of the most popular programming language in the world</li>\r\n	<li>It is easy to learn and simple to use</li>\r\n	<li>It is open-source and free</li>\r\n	<li>It is secure, fast and powerful</li>\r\n	<li>It has a huge community support (tens of millions of developers)</li>\r\n	<li>Java is an object oriented language which gives a clear structure to programs and allows code to be reused, lowering development costs</li>\r\n	<li>As Java is close to&nbsp;<a href=\"https://www.w3schools.com/cpp/default.asp\">C++</a>&nbsp;and&nbsp;<a href=\"https://www.w3schools.com/cs/default.asp\">C#</a>, it makes it easy for programmers to switch to Java or vice versa</li>\r\n</ul>', NULL, 0, 'lecture', NULL, 1, 1, NULL, NULL, NULL, NULL, '2021-02-18 09:15:24', '2021-02-22 04:47:59'),
(22, 243, 14, 13, 'Java Install', 'java-install', '<p>Some PCs might have Java already installed.</p>\r\n\r\n<p>To check if you have Java installed on a Windows PC, search in the start bar for Java or type the following in Command Prompt (cmd.exe):</p>\r\n\r\n<p>C:\\Users\\Your Name&gt;java -version</p>\r\n\r\n<p>If Java is installed, you will see something like this (depending on version):</p>\r\n\r\n<p><code>java version &quot;11.0.1&quot; 2018-10-16 LTS<br />\r\nJava(TM) SE Runtime Environment 18.9 (build 11.0.1+13-LTS)<br />\r\nJava HotSpot(TM) 64-Bit Server VM 18.9 (build 11.0.1+13-LTS, mixed mode)</code></p>\r\n\r\n<p>If you do not have Java installed on your computer, you can download it for free at&nbsp;<a href=\"https://www.oracle.com/technetwork/java/javase/overview/index.html\" target=\"_blank\">oracle.com</a>.</p>\r\n\r\n<p><strong>Note:</strong>&nbsp;In this tutorial, we will write Java code in a text editor. However, it is possible to write Java in an Integrated Development Environment, such as IntelliJ IDEA, Netbeans or Eclipse, which are particularly useful when managing larger collections of Java files.</p>\r\n\r\n<hr />\r\n<h2>Setup for Windows</h2>\r\n\r\n<p>To install Java on Windows:</p>\r\n\r\n<ol>\r\n	<li>Go to &quot;System Properties&quot; (Can be found on Control Panel &gt; System and Security &gt; System &gt; Advanced System Settings)</li>\r\n	<li>Click on the &quot;Environment variables&quot; button under the &quot;Advanced&quot; tab</li>\r\n	<li>Then, select the &quot;Path&quot; variable in System variables and click on the &quot;Edit&quot; button</li>\r\n	<li>Click on the &quot;New&quot; button and add the path where Java is installed, followed by&nbsp;<strong>\\bin</strong>. By default, Java is installed in C:\\Program Files\\Java\\jdk-11.0.1 (If nothing else was specified when you installed it). In that case, You will have to add a new path with:&nbsp;<strong>C:\\Program Files\\Java\\jdk-11.0.1\\bin</strong><br />\r\n	Then, click &quot;OK&quot;, and save the settings</li>\r\n	<li>At last, open Command Prompt (cmd.exe) and type&nbsp;<strong>java -version</strong>&nbsp;to see if Java is running on your machine</li>\r\n</ol>', NULL, 0, 'lecture', NULL, 1, 2, NULL, NULL, NULL, NULL, '2021-02-18 09:16:36', '2021-02-22 04:47:59'),
(23, 243, 14, 13, 'Java Quickstart', 'java-quickstart', '<p>In Java, every application begins with a class name, and that class must match the filename.</p>\r\n\r\n<p>Let&#39;s create our first Java file, called Main.java, which can be done in any text editor (like Notepad).</p>\r\n\r\n<p>The file should contain a &quot;Hello World&quot; message, which is written with the following code:</p>\r\n\r\n<p>Main.java</p>\r\n\r\n<p><code>public class Main { public static void main(String[] args) { System.out.println(&quot;Hello World&quot;); } }</code></p>', NULL, 0, 'lecture', NULL, 1, 3, NULL, NULL, NULL, NULL, '2021-02-18 09:17:07', '2021-02-22 04:47:59'),
