(27, 243, 24, 15, 'What is IAM (Identity and access management)?', 'what-is-iam-identity-and-access-management', '<h3>If we wanted to understand in simple words, let&#39;s break it down:</h3>\r\n\r\n<ul>\r\n	<li><strong>The first word is Identity ~</strong>&nbsp;This, we can relate to the punch card attendance system. It&#39;s usually a flat and stiff paper and contains digital information, people just need to wave near a reader, and then ensures whether the correct person is logging in/out. Similarly, here it also means&nbsp;<code>verifying the user who they claim to be</code>.</li>\r\n	<li><strong>Second is Access ~</strong>&nbsp;This determines what level of access is provided to an individual. An easy way to understand is if you go to a nightclub/Casino, and there are guards taking care of who is allowed to come in, who can access the VIP area.</li>\r\n	<li><strong>Third is Management ~</strong>&nbsp;All of this falls under IT (Security) departments to manage the access control, policies, reporting, etc.</li>\r\n</ul>\r\n\r\n<h4>A little more about it:</h4>\r\n\r\n<p>Identity and access management&nbsp;also called&nbsp;Identity Management system (IDMS)&nbsp;in the enterprise is as crucial as anything these days and it&#39;s all about setting up standards and addressing the needs around enabling the right access at the right time for individuals to access not only IT resources but the hardware and applications employees require. It&#39;s often required to meet rigorous and complex security compliance requirements.</p>\r\n\r\n<p>IAM&rsquo;s pretty popular especially with enterprises as there is a critical need to manage information that is spread across internal and external applications with data security in mind.</p>\r\n\r\n<p>IAM&rsquo;s core objective is to assign&nbsp;<code>one identity per individual</code>&nbsp;and have the ability to control it from one place which would help reflect in all systems. It also helps the ability to monitor user&rsquo;s activities, permit user roles, enforce policies at org level which is an on-going process (basically handles authn (Authentication) and authz (Authorization)).</p>\r\n\r\n<h3>How IAM works?</h3>\r\n\r\n<p>IAM is designed to perform three things -</p>\r\n\r\n<ul>\r\n	<li>Identify</li>\r\n	<li>Authn (Authentication)</li>\r\n	<li>Authz (Authorization)</li>\r\n</ul>\r\n\r\n<p>A lot of people gets confused b/w Authentication and Authorization, ill try to explain in a simplistic way:</p>\r\n\r\n<ul>\r\n	<li><strong>Authentication:</strong>&nbsp;When you enter a username/email &amp; password into an application, the app tries to authenticate by checking the database and if the information which you entered matches; that means you are authenticated.</li>\r\n	<li><strong>Authorization:</strong>&nbsp;This simply means the level of access. For example: If you log in to Facebook, you are allowed to see other&rsquo;s profiles but not modify it.</li>\r\n	<li>\r\n	<p>That being said, here are the core components of any IAM system:</p>\r\n	</li>\r\n	<li><strong>Identity Management:</strong>&nbsp;As the name suggests, it means managing every aspect of an individual&rsquo;s identity. This includes managing Onboarding (provisioning), offboarding (de-provisioning), and on-going sync from the source to target systems/directories. And there are multiple identity protocols being used such as OAuth2.0, OIDC, SAML, LDAP, etc. For Identity management to happen, there are few building blocks required:\r\n	<ol>\r\n		<li><strong>Source:</strong>&nbsp;The origin of the individual (from where the identities originate) i.e kind of a directory of the personal data used to define individual users. This is usually done by looking at the applications which contain staff data to be the source of truth.</li>\r\n		<li><strong>Central Repository:</strong>&nbsp;For user&rsquo;s information to be consistent b/w source and target system, syncing is essential. And for syncing to happen, it&#39;s important to have a central store that presents a logical view of the identities of an enterprise. It usually works by identifying a unique identifier basis to ensure that the provisioning, de-provisioning, updates are happening accurately.</li>\r\n		<li><strong>Target:</strong>&nbsp;These systems can be defined as any application being used which requires authentication and authorization. For example, company portals, mobile apps, etc.</li>\r\n	</ol>\r\n	</li>\r\n	<li><strong>Authentication:</strong>&nbsp;Today, authentication does not only mean entering credentials and logging into a system but also making it secure by adding MFA, adaptive authentication.</li>\r\n	<li><strong>Authorisation:</strong>&nbsp;After authentication, the next step in any Identity and access management system comes is authorizing the users for assigned access to specific apps, resources based on the user&rsquo;s provisioning.</li>\r\n	<li><strong>Reporting:</strong>&nbsp;This is all about recording, capturing user activities, auditing, monitoring, etc. This ultimately helps enterprises prove compliance with regulations, identify and address any potential security risks, and improve it further down the lane.</li>\r\n	<li>\r\n	<h3>Why do we need IAM?</h3>\r\n	</li>\r\n	<li><strong>Security:</strong>&nbsp;This is one of the core motives for any organization introducing IAM i.e controlling access which ultimately results in preventing identity theft, illegal access to sensitive information. It can also prevent unauthorized logins, protect against phishing attacks (and other cyber attacks). It also incorporates proper reporting, regardless of the application, platform, decide (Including BYOD options), helping with Location flexibility.</li>\r\n	<li><strong>Compliance:</strong>&nbsp;IAM is not just about keeping things secure; intact following certain regulations according to the region is also crucial. So, compliance like HIPAA, PCI, GDPR, etc can be ensured since IAM specify strict protocols to control what and how of n/w and resources users can use.</li>\r\n	<li><strong>Cost Reduction &amp; Maintainability:</strong>&nbsp;If there is any change to the organization-wide followed policy e.g. &ldquo;Password Policy&rdquo;, then with IAM, it can be done in one go. Hence reducing the workload of requests to the IT team to do it. Furthermore, it reduces Identity management costs like Onboarding, offboarding, implementing policies, processes, etc</li>\r\n	<li><strong>Improves User Experience:</strong>&nbsp;IAM helps with implementing the &ldquo;Single sign-on&rdquo; feature which is really trending especially in enterprises. With SSO, the user does not need to enter passwords to access multiple systems.</li>\r\n	<li>\r\n	<h3>Must-haves before/during IAM implementation:</h3>\r\n	</li>\r\n	<li>I was reading one article about&nbsp;<code>the concept of putting all your eggs in one basket is a bit scary</code>. A centralized system may seem tempting but its also usually an opportunity for hackers and by putting dashboards, monitoring user&rsquo;s activity closely will help prevent it.</li>\r\n	<li>Working with legacy systems since most of the enterprises try to work it out but sometimes that&rsquo;s not how it works with newer tech. Keeping the legacy systems alive with redundant workloads/tasks should be avoided as much it&rsquo;s possible.</li>\r\n	<li>Collaboration is important across different departments is necessary. Working with our stakeholders step by step with everyone&rsquo;s buy-in help in the long run for taking crucial decisions.</li>\r\n	<li>Multiple sources of identity information creates issues as well sometime, but the IAM system should be able to take care of that beforehand; synchronizing the identity across different systems.</li>\r\n	<li>&nbsp;</li>\r\n	<li><strong>SSO:</strong>&nbsp;This is my favorite, one the best ones. Keeping security in mind, it enhances the user experience a lot since the number of credentials an employee requires to access is automatically reduced. And it&#39;s much easier to control the user&rsquo;s access from one place. I read somewhere, SSOs become SPOFs if not implemented correctly, and here too a centralized IAM system allows to control access more efficiently.</li>\r\n</ul>', NULL, 0, 'lecture', NULL, 1, 1, NULL, NULL, NULL, NULL, '2021-02-23 07:19:40', '2021-02-23 07:19:40'),
