(43, 326, 40, 24, 'Numpy Arrays', 'numpy-arrays', '<p>Numpy arrays are great alternatives to Python Lists. Some of the key advantages of Numpy arrays are that they are fast, easy to work with, and give users the opportunity to perform calculations across entire arrays.</p>\r\n\r\n<p>In the following example, you will first create two Python lists. Then, you will import the numpy package and create numpy arrays out of the newly created lists.</p>\r\n\r\n<h3>Element-wise calculations</h3>\r\n\r\n<p>Now we can perform element-wise calculations on height and weight. For example, you could take all 6 of the height and weight observations above, and calculate the BMI for each observation with a single equation. These operations are very fast and computationally efficient. They are particularly helpful when you have 1000s of observations in your data.</p>\r\n\r\n<h3>Subsetting</h3>\r\n\r\n<p>Another great feature of Numpy arrays is the ability to subset. For instance, if you wanted to know which observations in our BMI array are above 23, we could quickly subset it to find out.</p>', '{\"source\":\"youtube\",\"html5_video_id\":null,\"html5_video_poster_id\":null,\"source_external_url\":null,\"source_youtube\":\"https:\\/\\/www.youtube.com\\/watch?v=_uQrJ0TkZlc\",\"source_vimeo\":null,\"source_embedded\":null,\"runtime\":{\"hours\":\"1\",\"mins\":\"00\",\"secs\":\"00\"}}', 3600, 'lecture', NULL, 1, 1, NULL, NULL, NULL, NULL, '2021-03-15 10:36:46', '2021-03-15 10:37:57'),
(44, 326, 40, 24, 'Python for Finance: Part 1', 'python-for-finance-part-1', '<p>Take the quiz test your understanding of the key concepts covered in the chapter. Try testing yourself before you read the chapter to see where your strengths and weaknesses are, then test yourself again once you&rsquo;ve read the chapter to see how well you&rsquo;ve understood.</p>', NULL, 0, 'quiz', 0, 1, 2, '{\"show_time\":\"1\",\"time_limit\":\"10\",\"passing_score\":\"10\",\"questions_limit\":\"10\"}', 1, NULL, NULL, '2021-03-15 11:24:37', '2021-03-15 11:29:59');
