(45, 1, 30, 25, 'Data Binding', 'data-binding', '<p>Data Binding is available right from AngularJS, and all the versions of Angular released later on. We use curly braces for data binding - {{}}; this process is called interpolation. We have already seen in our previous examples how we declared the value to the variable title and the same is printed in the browser.</p>\r\n\r\n<p>The variable in the&nbsp;<b>app.component.html</b>&nbsp;file is referred as&nbsp;<b>{{title}}</b>&nbsp;and the value of&nbsp;<b>title</b>&nbsp;is initialized in the&nbsp;<b>app.component.ts</b>&nbsp;file and in&nbsp;<b>app.component.html</b>, the value is displayed.</p>\r\n\r\n<p>Let us now create a dropdown of months in the browser. To do that, we have created an array of months in&nbsp;<b>app.component.ts</b>&nbsp;as follows &minus;</p>\r\n\r\n<p>import { Component } from &#39;@angular/core&#39;; @Component({ selector: &#39;app-root&#39;, templateUrl: &#39;./app.component.html&#39;, styleUrls: [&#39;./app.component.css&#39;] }) export class AppComponent { title = &#39;Angular 7&#39;; // declared array of months. months = [&quot;January&quot;, &quot;February&quot;, &quot;March&quot;, &quot;April&quot;, &quot;May&quot;, &quot;June&quot;, &quot;July&quot;, &quot;August&quot;, &quot;September&quot;, &quot;October&quot;, &quot;November&quot;, &quot;December&quot;]; }</p>\r\n\r\n<p>The month&rsquo;s array that is shown above is to be displayed in a dropdown in the browser.</p>\r\n\r\n<p>We have created the normal select tag with option. In option, we have used the&nbsp;<b>for loop</b>. The&nbsp;<b>for loop</b>&nbsp;is used to iterate over the months&rsquo; array, which in turn will create the option tag with the value present in the months.</p>\r\n\r\n<p>The syntax for in Angular is as follows &minus;</p>\r\n\r\n<p>*ngFor = &ldquo;let I of months&rdquo;</p>\r\n\r\n<p>and to get the value of months we are displaying it in &minus;</p>\r\n\r\n<p>{{i}}</p>\r\n\r\n<p>The two curly brackets help with data binding. You declare the variables in your app.component.ts file and the same will be replaced using the curly brackets.</p>\r\n\r\n<p>Following is the output of the above month&rsquo;s array in the browser.</p>\r\n\r\n<p>The variable that is set in the&nbsp;<b>app.component.ts</b>&nbsp;can be binded inside the&nbsp;<b>app.component.html</b>&nbsp;using the curly brackets. For example: {{}}.</p>\r\n\r\n<p>Let us now display the data in the browser based on condition. Here, we have added a variable and assigned the value as&nbsp;<b>true</b>. Using the if statement, we can hide/show the content to be displayed.</p>\r\n\r\n<p>import { Component } from &#39;@angular/core&#39;; @Component({ selector: &#39;app-root&#39;, templateUrl: &#39;./app.component.html&#39;, styleUrls: [&#39;./app.component.css&#39;] }) export class AppComponent { title = &#39;Angular 7&#39;; // declared array of months. months = [&quot;January&quot;, &quot;February&quot;, &quot;March&quot;, &quot;April&quot;, &quot;May&quot;, &quot;June&quot;, &quot;July&quot;, &quot;August&quot;, &quot;September&quot;, &quot;October&quot;, &quot;November&quot;, &quot;December&quot;]; isavailable = true; //variable is set to true }</p>\r\n\r\n<p><b>app.component.html</b></p>\r\n\r\n\r\n<div style=\"text-align:center\">\r\n<h1>Welcome to {{title}}.</h1>\r\n</div>\r\n\r\n<div>Months : {{i}} </div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div><span>Condition is valid.</span> //over here based on if condition the text condition is valid is displayed. //If the value of isavailable is set to false it will not display the text.</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Let us explain the above example using the&nbsp;<b>IF THEN ELSE</b>&nbsp;condition.</p>\r\n\r\n<h3>Example</h3>\r\n\r\n<p>import { Component } from &#39;@angular/core&#39;; @Component({ selector: &#39;app-root&#39;, templateUrl: &#39;./app.component.html&#39;, styleUrls: [&#39;./app.component.css&#39;] }) export class AppComponent { title = &#39;Angular 7&#39;; // declared array of months. months = [&quot;January&quot;, &quot;Feburary&quot;, &quot;March&quot;, &quot;April&quot;, &quot;May&quot;,&quot;June&quot;, &quot;July&quot;, &quot;August&quot;, &quot;September&quot;, &quot;October&quot;, &quot;November&quot;, &quot;December&quot;]; isavailable = false; //variable is set to true }</p>\r\n\r\n<p>In this case, we have made the&nbsp;<b>isavailable</b>&nbsp;variable as false. To print the&nbsp;<b>else</b>&nbsp;condition, we will have to create the&nbsp;<b>ng-template</b>&nbsp;as follows &minus;</p>\r\nCondition is invalid\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The full code is given below &minus;</p>\r\n\r\n<p></p>\r\n\r\n<div style=\"text-align:center\">\r\n<h1>Welcome to {{title}}.</h1>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>Months : {{i}} </div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div><span>Condition is valid.</span> Condition is invalid</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If is used with the else condition and the variable used is&nbsp;<b>condition1</b>. The same is assigned as an&nbsp;<b>id</b>&nbsp;to the&nbsp;<b>ng-template</b>, and when the available variable is set to false the text&nbsp;<b>Condition is invalid</b>&nbsp;is displayed.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, 'lecture', NULL, 1, 1, NULL, NULL, NULL, NULL, '2021-03-18 07:34:18', '2021-03-18 07:34:22'),
