INSERT INTO `courses` (`id`, `user_id`, `parent_category_id`, `second_category_id`, `category_id`, `title`, `slug`, `short_description`, `description`, `benefits`, `requirements`, `cert_accr`, `price_plan`, `price`, `sale_price`, `level`, `status`, `is_presale`, `launch_at`, `thumbnail_id`, `video_src`, `total_video_time`, `require_enroll`, `require_login`, `total_lectures`, `total_assignments`, `total_quiz`, `rating_value`, `rating_count`, `five_star_count`, `four_star_count`, `three_star_count`, `two_star_count`, `one_star_count`, `is_featured`, `featured_at`, `is_popular`, `popular_added_at`, `last_updated_at`, `published_at`, `created_at`, `updated_at`, `accepted_trainer_id`) VALUES
(1, 1, 1, 3, 4, 'Machine Learning A-Z™: Hands-On Python & R In Data Science11', 'new-course', 'Course DescriLearn to create Machine Learning Algorithms in Python and R from two Data Science experts. Code templates included.ption', '<p>Interested in the field of Machine Learning?&nbsp;Then this course is for you!</p>\r\n\r\n<p>This course has been designed by two professional Data Scientists so that we can share our knowledge and help you learn complex theory,&nbsp;algorithms, and coding libraries in a simple way.</p>\r\n\r\n<p>We will walk you step-by-step into the World of Machine Learning. With every tutorial, you will develop new skills and improve your understanding of this challenging yet lucrative sub-field of Data Science.</p>\r\n\r\n<p>This course is&nbsp;fun and exciting, but at the same time, we dive deep into Machine Learning. It is structured the following way:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Part 1 - Data Preprocessing</p>\r\n	</li>\r\n	<li>\r\n	<p>Part 2 - Regression: Simple Linear Regression, Multiple Linear Regression,&nbsp;Polynomial&nbsp;Regression,&nbsp;SVR, Decision Tree Regression,&nbsp;Random Forest Regression</p>\r\n	</li>\r\n	<li>\r\n	<p>Part 3 - Classification: Logistic Regression, K-NN, SVM, Kernel SVM, Naive Bayes, Decision Tree Classification,&nbsp;Random&nbsp;Forest Classification</p>\r\n	</li>\r\n	<li>\r\n	<p>Part 4 - Clustering: K-Means,&nbsp;Hierarchical Clustering</p>\r\n	</li>\r\n	<li>\r\n	<p>Part 5 - Association Rule Learning: Apriori,&nbsp;Eclat</p>\r\n	</li>\r\n	<li>\r\n	<p>Part 6 - Reinforcement Learning:&nbsp;Upper Confidence Bound,&nbsp;Thompson Sampling</p>\r\n	</li>\r\n	<li>\r\n	<p>Part 7 - Natural Language Processing: Bag-of-words model&nbsp;and&nbsp;algorithms for NLP</p>\r\n	</li>\r\n	<li>\r\n	<p>Part 8 - Deep Learning: Artificial Neural Networks,&nbsp;Convolutional Neural Networks</p>\r\n	</li>\r\n	<li>\r\n	<p>Part 9 - Dimensionality Reduction: PCA, LDA, Kernel PCA</p>\r\n	</li>\r\n	<li>\r\n	<p>Part 10 - Model Selection &amp; Boosting: k-fold Cross Validation, Parameter Tuning, Grid Search,&nbsp;XGBoost</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Moreover, the course is packed with practical exercises that are based on real-life&nbsp;examples. So not only will you learn the theory, but you will also get some hands-on practice building your own models.</p>\r\n\r\n<p>And as a bonus, this course includes both&nbsp;Python and R&nbsp;code templates which you can download and use on your own projects.</p>\r\n\r\n<p>Important updates (June 2020):</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>CODES ALL UP TO DATE</p>\r\n	</li>\r\n	<li>\r\n	<p>DEEP LEARNING CODED IN TENSORFLOW 2.0</p>\r\n	</li>\r\n	<li>\r\n	<p>TOP GRADIENT BOOSTING MODELS INCLUDING XGBOOST AND EVEN CATBOOST!</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Who this course is for:</h2>\r\n\r\n<ul>\r\n	<li>Anyone interested in Machine Learning.</li>\r\n	<li>Students who have at least high school knowledge in math and who want to start learning Machine Learning.</li>\r\n	<li>Any intermediate level people who know the basics of machine learning, including the classical algorithms like linear regression or logistic regression, but who want to learn more about it and explore all the different fields of Machine Learning.</li>\r\n	<li>Any people who are not that comfortable with coding but who are interested in Machine Learning and want to apply it easily on datasets.</li>\r\n	<li>Any students in college who want to start a career in Data Science.</li>\r\n	<li>Any data analysts who want to level up in Machine Learning.</li>\r\n	<li>Any people who are not satisfied with their job and who want to become a Data Scientist.</li>\r\n	<li>Any people who want to create added value to their business by using powerful Machine Learning tools.</li>\r\n</ul>', 'Master Machine Learning on Python & R\r\nHave a great intuition of many Machine Learning models\r\nMake accurate predictions\r\nMake powerful analysis\r\nMake robust Machine Learning models\r\nCreate strong added value to your business\r\nUse Machine Learning for personal purpose\r\nHandle specific topics like Reinforcement Learning, NLP and Deep Learning\r\nHandle advanced techniques like Dimensionality Reduction\r\nKnow which Machine Learning model to choose for each type of problem\r\nBuild an army of powerful Machine Learning models and know how to combine them to solve any problem', 'Just some high school mathematics level.', NULL, 'free', NULL, NULL, 2, 1, 0, NULL, 1, '{\"source\":\"youtube\",\"html5_video_id\":null,\"html5_video_poster_id\":null,\"source_external_url\":null,\"source_youtube\":\"https:\\/\\/www.youtube.com\\/watch?v=yXzWfZ4N4xU\",\"source_vimeo\":null,\"source_embedded\":null}', 0, 1, 1, 1, 0, 1, '5.00', 2, 2, 0, 0, 0, 0, NULL, NULL, NULL, NULL, '2020-12-19 05:38:37', '2020-12-19 06:07:02', '2020-12-19 05:35:37', '2021-02-06 18:21:59', NULL),
(2, 1, 5, 6, 7, 'Learn Python Programming Masterclass', 'learn-python-programming-masterclass', 'This Python For Beginners Course Teaches You The Python Language Fast. Includes Python Online Training With Python 3', '<p>Whether you want to:</p>\r\n\r\n<p>- build the skills you need to get your first&nbsp;Python programming job</p>\r\n\r\n<p>- move to a more senior software developer position</p>\r\n\r\n<p>- get started with Machine Learning, Data Science, Django or other hot areas that Python specialises in</p>\r\n\r\n<p>- or just learn Python to be able to create your own Python apps quickly.</p>\r\n\r\n<p>&hellip;then you need a solid foundation in Python programming. And this course is designed to give you those core skills, fast.</p>\r\n\r\n<p>This course is aimed at complete beginners who have never programmed before, as well as existing programmers who want to increase their career options by learning Python.</p>\r\n\r\n<p>The fact is, Python is one of the most popular programming languages in the world &ndash; Huge companies like Google use it in mission critical applications like Google Search.</p>\r\n\r\n<p>And Python is the number one language choice for machine learning, data science and artificial intelligence. To get those high paying jobs you need an expert knowledge of Python, and that&rsquo;s what you will get from this course.</p>\r\n\r\n<p>By the end of the course you&rsquo;ll be able to apply in confidence for Python programming jobs. And yes, this applies even if you have never programmed before. With the right skills which you will learn in this course, you can become employable and valuable in the eyes of future employers.</p>\r\n\r\n<p>Here&rsquo;s what a few students have told us about the course after going through it.</p>\r\n\r\n<p>&ldquo;I had very limited programming experience before I started this course, so I have really learned a lot from the first few sections. It has taken me from essentially zero programming skill to a level where I&#39;m comfortable using Python to analyze data for my lab reports, and I&#39;m not even halfway done the course yet. There are other courses out there which focus on data analysis, but those courses are usually targeted at people who already know how to program which is why I chose this course instead. &ldquo; &ndash; Christian DiMaria<br />\r\n<br />\r\n&ldquo;I have been puttering through your Python course . In that time, though, and without finishing it yet I&#39;ve been able to automate quite a bit at my work. I work in a school system and unifying data from our various student information systems can be incredibly frustrating, time consuming, and at times challenging. Using your course, I&#39;ve learned enough to write applications that turn massive text files into dictionaries that get &quot;stitched&quot; together like a database and output to properly formatted CSV files and then uploaded via SFTP to various systems for secure processing. Our teachers, students, and the tech department have greatly benefitted from this automation. I just wanted to drop you a note thanking you for helping me learn this skill.&rdquo; &ndash; Keith Medlin<br />\r\n<br />\r\n&ldquo;This course was great. Within 3 weeks I was able to write my own database related applications.&rdquo; &ndash; Theo Coenen<br />\r\n<br />\r\nAnd there are many more students who love the course &ndash; check out all the reviews for yourself.</p>\r\n\r\n<p><strong>Will this course give you core python skills?</strong></p>\r\n\r\n<p>Yes it will.&nbsp; There are a range of exciting opportunities for Python developers. All of them require a solid understanding of Python, and that&rsquo;s what you will learn in this course.</p>\r\n\r\n<p><strong>Will the course teach me data science, machine learning and artificial intelligence?</strong></p>\r\n\r\n<p>No, it won&rsquo;t do that &ndash; All of these topics are branches of Python programming.&nbsp; And all of them require a solid understanding of the Python language.</p>\r\n\r\n<p>Nearly all courses on these topics assume that you understand Python, and without it you will quickly become lost and confused.</p>\r\n\r\n<p>This course will give you that core, solid understanding of the Python programming language.</p>\r\n\r\n<p>By the end of the course you will be ready to apply for Python programming positions as well as move on to specific areas of Python, as listed above.</p>\r\n\r\n<p><strong>Why should you take this course?</strong></p>\r\n\r\n<p>There are a lot of Python courses on Udemy &ndash; Your instructors, Tim and Jean-Paul are pretty unique in that between them they have around 70 years of professional programming experience.&nbsp; That&rsquo;s more than a lifetime of skills you get to learn Python from.</p>\r\n\r\n<p>You can enrol in the course safe in the knowledge that they are not just teachers, but professional programmers with real commercial programming experience, having worked with big companies like IBM, Mitsubishi, Fujitsu and Saab in the past.</p>\r\n\r\n<p>As such you will not only be learning Python, but you will be learning industry best practices for Python programming that real employers demand.&nbsp;</p>\r\n\r\n<p>And if that&rsquo;s not enough take a read of some of the many reviews from happy students &ndash; there are around 100,000 students who have left around 19,000 reviews.</p>\r\n\r\n<p>This is one of the most popular courses on Python programming on Udemy.</p>\r\n\r\n<p><strong>Here&rsquo;s just some of what you&rsquo;ll learn</strong></p>\r\n\r\n<p>(It&rsquo;s okay if you don&rsquo;t understand all this yet, you will in the course)</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; All the essential Python keywords, operators, statements, and expressions needed to fully understand exactly what you&rsquo;re coding and why - making programming easy to grasp and less frustrating</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You will learn the answers to questions like What is the Python For Loop, what is Python used for, how Python switch the traditional syntax of code, and more.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Complete chapters on object-oriented programming and many other aspects of Python, including tKInter (for building GUI Interfaces) and using databases with Python.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Although this is primarily a Python 3 course, a python developer will need to work with Python 2 projects from time to time &ndash; We&rsquo;ll show the difference in both versions to make sure you understand how things work differently in each version.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;How to develop powerful Python applications using one of the most powerful Integrated Development Environments on the market, IntelliJ IDEA! - Meaning you can code functional programs easier. &nbsp;<strong>IntelliJ</strong>&nbsp;has both a&nbsp;<strong>FREE</strong>&nbsp;and&nbsp;PAID version, and you can use either in this course.&nbsp; PyCharm will also work just fine.</p>\r\n\r\n<p>(Don&rsquo;t worry if you want to use another IDE. You&rsquo;re free to use any IDE and still get the most out of this course).<br />\r\n<br />\r\n<strong>Does the course get updated?</strong></p>\r\n\r\n<p>It&rsquo;s no secret how technology is advancing at a rapid rate. New, more powerful hardware and software are being released&nbsp;every day, meaning it&rsquo;s crucial to stay on top with the latest knowledge.<br />\r\n<br />\r\nA lot of other courses on Udemy get released once, and never get updated.&nbsp; Learning from an outdated course and/or an outdated version of Python can be counter productive and even worse it could teach you the wrong way to do things.</p>\r\n\r\n<p>For example if you apply some parts of Python 2 to Python 3 code, you will get completely different results.</p>\r\n\r\n<p>We cover differences like this in the course and also continually update the course as well.</p>\r\n\r\n<p><strong>What if you have questions?</strong></p>\r\n\r\n<p>As if this course wasn&rsquo;t complete enough, we offer&nbsp;<strong>full support</strong>, answering any questions you have&nbsp;<strong>7 days a week</strong>&nbsp;(whereas many instructors answer just once per week,&nbsp;or not at all).</p>\r\n\r\n<p>This means you&rsquo;ll never find yourself stuck on one lesson for days on end. With our hand-holding guidance, you&rsquo;ll progress smoothly through this course without any major roadblocks.</p>\r\n\r\n<p>That&rsquo;s just one reason why Tim was voted&nbsp;<strong>top 10 in the&nbsp; Udemy instructor awards</strong>&nbsp;(out of a whopping 18,000 instructors), and quickly became a top-rated, bestselling instructor on the Udemy site. &nbsp;</p>\r\n\r\n<p>Student Quote: &ldquo;Tim and JP are excellent teachers and are constantly answering questions and surveying students on new topics they will like to learn. This isn&#39;t a Python course it&rsquo;s THE Python course you need.&rdquo; &ndash; Sean Burger</p>\r\n\r\n<p><strong>There&rsquo;s no risk either!</strong></p>\r\n\r\n<p>This course comes with a&nbsp;<strong>full 30 day money-back guarantee</strong>. Meaning if you are not completely satisfied with the course or your progress, simply let Tim or J-P know and they will refund you 100%, every last penny no questions asked.</p>\r\n\r\n<p>You either end up with Python skills, go on to develop great programs and potentially make an awesome career for yourself, or you try the course and simply get all your money back if you don&rsquo;t like it&hellip;</p>\r\n\r\n<p><strong>You literally can&rsquo;t lose.</strong></p>\r\n\r\n<p><strong>Ready to get started, developer?</strong></p>\r\n\r\n<p><strong>Enrol now&nbsp;</strong>using the &ldquo;Add to Cart&rdquo; button on the right, and get started on your way to creative, advanced Python brilliance. Or, take this course for a free spin using the preview feature, so you know you&rsquo;re 100% certain this course is for you.</p>\r\n\r\n<p><strong>See you on the inside&nbsp;(hurry, your Python class is waiting!)</strong></p>\r\n\r\n<h2>Who this course is for:</h2>\r\n\r\n<ul>\r\n	<li>Beginners with no previous programming experience looking to obtain the skills to get their first programming job.</li>\r\n	<li>Anyone looking to to build the minimum Python programming skills necessary as a pre-requisites for moving into machine learning, data science, and artificial intelligence.</li>\r\n	<li>Existing programmers who want to improve their career options by learning the Python programming language.</li>\r\n	<li>If you are an expert Python programmer with extensive knowledge, and many years&rsquo; experience, then this course is probably not for you.</li>\r\n</ul>', 'Have a fundamental understanding of the Python programming language.\r\nHave the skills and understanding of Python to confidently apply for Python programming jobs.\r\nAcquire the pre-requisite Python skills to move into specific branches - Machine Learning, Data Science, etc..\r\nAdd the Python Object-Oriented Programming (OOP) skills to your résumé.\r\nUnderstand how to create your own Python programs.\r\nLearn Python from experienced professional software developers.\r\nUnderstand both Python 2 and Python 3.', 'You’ve either already got it or it’s FREE. Here’s the checklist:\r\nA computer - Windows, Mac, and Linux are all supported. Setup and installation instructions are included for each platform.\r\nYour enthusiasm to learn this go-to programming language. It’s a valuable lifetime skill which you can’t un-learn!\r\nEverything else needed to start programming in Python is already included in the course.', NULL, 'paid', '100.00', '50.00', 2, 1, 0, NULL, 1, '{\"source\":\"youtube\",\"html5_video_id\":null,\"html5_video_poster_id\":null,\"source_external_url\":null,\"source_youtube\":\"https:\\/\\/www.youtube.com\\/watch?v=emQSnPkLL9M\",\"source_vimeo\":null,\"source_embedded\":null