(24, 243, 20, 21, 22, 'AWS Certified Developer - Associate 2020', 'aws-certified-developer-associate-2020', 'Do you want AWS certification? Do you want to be an AWS Certified Developer Associate? This AWS online course is for you', '<p>Amazon Web Services - (AWS) Certification is fast becoming the must have certificate for any IT professional working with AWS. This course is designed to help you pass the&nbsp;<strong>AWS Certified Developer Associate (CDA) 2020&nbsp;Exam</strong>. Even if you have never logged in to the AWS platform before, by the end of our AWS training videos you will be able to take the CDA exam. No specific programming knowledge is needed (though knowing a language would be advantageous) and no prior AWS experience required. With AWS certification under your belt (and optionally after completing our AWS Certified Solutions Architect course - also available on Udemy), you will be in high demand by many employers and will command a superior salary.&nbsp;&nbsp;<strong>We have taught AWS to over half a million students on Udemy in the past 5 years.</strong></p>', 'Pass the AWS Certified Developer - Associate 2020 Exam\r\nBecome confident in creating basic Python and PHP code to manipulate AWS environments\r\nBecome intimately familiar with the AWS platform from a developer perspective.\r\nBecome Amazon Certified\r\nBecome A Cloud Guru', 'You will need to set up an AWS Account (you can use the free tier for this course)\r\nA Windows, Linux or Mac PC/Laptop\r\nKnowledge of at least 1 programming language (Php, Python, Ruby etc) is advantageous but not strictly required', NULL, 'paid', '1500.00', '1400.00', 3, 1, 0, NULL, 20, '{\"source\":\"youtube\",\"html5_video_id\":null,\"html5_video_poster_id\":null,\"source_external_url\":null,\"source_youtube\":\"https:\\/\\/www.youtube.com\\/watch?v=RrKRN9zRBWs\",\"source_vimeo\":null,\"source_embedded\":null}', 0, 1, 1, 1, 0, 1, '4.00', 1, 0, 1, 0, 0, 0, NULL, NULL, NULL, NULL, '2021-02-23 07:23:43', '2021-02-