(30, 1, 5, 6, 16, 'The Complete Angular Course: Beginner to Advanced', 'last-course', 'The most comprehensive Angular 4 (Angular 2+) course. Build a real e-commerce app with Angular, Firebase and Bootstrap 4', '<p>Angular is one of the most popular frameworks for building client apps with HTML, CSS and TypeScript. If you want to&nbsp;<strong>establish yourself as a front-end or a full-stack developer,</strong>&nbsp;you need to learn Angular.</p>\r\n\r\n<p>If you&#39;ve been confused or frustrated jumping from one Angular 4 tutorial to another, you&#39;ve come to the right place.&nbsp;In this course, Mosh,<strong>&nbsp;author of several best-selling&nbsp;courses on Udemy,&nbsp;</strong>takes you on&nbsp;<strong>a</strong><strong>&nbsp;fun&nbsp;and pragmatic journey to master&nbsp;Angular 4</strong><strong>.&nbsp;</strong></p>\r\n\r\n<p>By the end of watching this course, you&#39;ll be able to:&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Build real client apps with Angular&nbsp;</strong>on your own&nbsp;</li>\r\n	<li><strong>Troubleshoot</strong>&nbsp;common compile-time and run-time errors</li>\r\n	<li>Write&nbsp;<strong>clean and maintainable code&nbsp;</strong>like a professional</li>\r\n	<li>Apply&nbsp;<strong>best practices</strong>&nbsp;when building Angular apps&nbsp;</li>\r\n</ul>\r\n\r\n<p>Right from the beginning, you&#39;ll jump in and&nbsp;<strong>build your first Angular app within minutes</strong>. Say goodbye to boring tutorials and courses with rambling instructors and&nbsp;useless theories!</p>', 'Establish yourself as a skilled professional developer\r\nBuild real-world Angular applications on your own\r\nTroubleshoot common Angular errors\r\nMaster the best practices\r\nWrite clean and elegant code like a professional developer', 'Basic familiarity with HTML, CSS and JavaScript\r\nNO knowledge of Angular 1 or Angular 2 is required', 'Human Resources Certifications', 'paid', '1200.00', '1000.00', 2, 1, 0, NULL, 33, '{\"source\":\"youtube\",\"html5_video_id\":null,\"html5_video_poster_id\":null,\"source_external_url\":null,\"source_youtube\":\"https:\\/\\/www.youtube.com\\/watch?v=2OHbjep_WjQ\",\"source_vimeo\":null,\"source_embedded\":null}', 0, 1, 1, 1, 0, 1, '0.00', 0, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, '2021-03-18 07:41:02', '2021-03-18 07:42:52', '2021-02-24 14:07:26', '2021-03-18 07:42:52', NULL),
