(32, 283, 5, 25, 29, 'SAFe Agilist: Leading SAFe 5.1', 'safe-agilist-leading-safe-51', 'To overcome the challenges currently associated with attending in-person training, agil8 have adapted the delivery of this course into a live online training format with added focus on how to', '<p>During this course, attendees gain the knowledge necessary to lead a Lean-Agile enterprise by leveraging the Scaled Agile Framework&reg; (SAFe&reg;) and its underlying principles derived from Lean, systems thinking, Agile development, product development flow, and DevOps. Participants in the class gain insights into mastering Business Agility in order to thrive in the competitive market. They discuss how to establish team and technical agility and organise and re-organise around the flow of value. They also learn and practice the skills for supporting and executing PI Planning events and coordinating multiple Agile Release Trains (ARTs). Participants in the class explore the importance of adopting a customer-centric mindset and design thinking approach to agile product delivery. Learners also develop an understanding for implementing a Lean Portfolio Management function in their enterprise. Attending the class prepares individuals to take the exam and become a certified SAFe&reg; Agilist (SA).</p>', 'By the end of this course, and to perform the role of a SAFe® Agilist, attendees should be able to:\r\n\r\nLead the transformation to Business Agility with SAFe\r\nBecome a Lean-Agile Leader\r\nUnderstand customer needs with Design Thinking\r\nEnable Agile Product Delivery\r\nImplement Lean Portfolio Management', NULL, NULL, 'free', NULL, NULL, 0, 1, 0, NULL, 21, '{\"source\":\"youtube\",\"html5_video_id\":null,\"html5_video_poster_id\":null,\"source_external_url\":null,\"source_youtube\":null,\"source_vimeo\":null,\"source_embedded\":null}', 0, 1, 1, 2, 1, 2, '0.00', 0, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, '2021-02-26 12:02:11', '2021-02-26 11:04:01', '2021-02-26 08:56:43', '2021-02-26 