(38, 302, 5, 6, 16, 'Premiere Pro CC for Beginners: Video Editing in Premiere', 'premiere-pro-cc-for-beginners-video-editing-in-premiere', 'Learn how to edit videos in Adobe Premiere Pro with these easy-to-follow Premiere Pro video editing tutorials', '<ul>\r\n	<li>\r\n	<p>Master Premiere Pro and be CONFIDENT Editing Your Own Videos</p>\r\n	</li>\r\n	<li>\r\n	<p>Edit an entire video from beginning to end, using professional and efficient techniques.</p>\r\n	</li>\r\n	<li>\r\n	<p>By the end of the course, you&#39;ll have edited your own short documentary using either the supplied footage (video clips, photos, graphics, music, etc.), or your own footage!</p>\r\n	</li>\r\n	<li>\r\n	<p>Start a project with the right settings for any type of video, from any camera.</p>\r\n	</li>\r\n	<li>\r\n	<p>Export and save your videos for HD playback.</p>\r\n	</li>\r\n	<li>\r\n	<p>Edit your videos, and make them more dynamic with cutaway footage and photos.</p>\r\n	</li>\r\n	<li>\r\n	<p>Design clean and professional titles for you videos.</p>\r\n	</li>\r\n	<li>\r\n	<p>Add motion to your titles, photos, and videos... making them more visually interesting.</p>\r\n	</li>\r\n	<li>\r\n	<p>Color correct your video to fix issues with white balance and exposure.</p>\r\n	</li>\r\n	<li>\r\n	<p>Add a feeling to your video with color grading.</p>\r\n	</li>\r\n	<li>\r\n	<p>Apply visual effects such as stabilizing shaky video, removing grain, and making video more cinematic with overlays.</p>\r\n	</li>\r\n	<li>\r\n	<p>Edit green screen footage and, add backgrounds that actually look good.</p>\r\n	</li>\r\n</ul>', 'Master Premiere Pro and be CONFIDENT Editing Your Own Videos\r\nEdit an entire video from beginning to end, using professional and efficient techniques.\r\nBy the end of the course, you\'ll have edited your own short documentary using either the supplied footage (video clips, photos, graphics, music, etc.), or your own footage!\r\nStart a project with the right settings for any type of video, from any camera.\r\nExport and save your videos for HD playback.\r\nEdit your videos, and make them more dynamic with cutaway footage and photos.\r\nDesign clean and professional titles for you videos.\r\nAdd motion to your titles, photos, and videos... making them more visually interesting.\r\nColor correct your video to fix issues with white balance and exposure.\r\nAdd a feeling to your video with color grading.\r\nApply visual effects such as stabilizing shaky video, removing grain, and making video more cinematic with overlays.\r\nEdit green screen footage and, add backgrounds that actually look good.', 'Requirements\r\nStudents should have Adobe Premiere Pro installed on their computers to follow along. There are A LOT OF PRACTICE EXERCISES throughout this course with downloadable practice clips. We want you to follow along.\r\nWe teach this course using the Adobe Premiere Pro CC (creative cloud) versions, so it would be best if you\'re using CC. But you can still learn using CS6, CS5, CS4, or even CS3!', NULL, 'free', NULL, NULL, 1, 1, 0, NULL, 27, '{\"source\":\"html5\",\"html5_video_id\":null,\"html5_video_poster_id\":null,\"source_external_url\":null,\"source_youtube\":null,\"source_vimeo\":null,\"source_embedded\":null}', 0, 1, 1, 1, 0, 2, '0.00', 0, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, '2021-03-02 16:02:28', '2021-03-15 11:33:19', '2021-03-02 15:38:14', '2021-03-15 11:33:19', NULL),
